import { gql } from 'apollo-boost'

const getAuthorsQuery = gql`
  {
    authors {
      name
      id
    }
  }
`

const getBooksQuery = gql`
  {
    books {
      name
      id
    }
  }
`
const getBuyerQuery = gql`
  {
    buyers {
      firstname
      lastname
      password
    }
  }
`

export { getAuthorsQuery, getBooksQuery, getBuyersQuery }
